import React from 'react'
import EarningsSection from '../Components/ProfileSection/EarningsSection'
import Profile from '../Components/ProfileSection/Profile'

const EarningsPage = () => {
  return (
    <div>
        <Profile/>
        <EarningsSection/>
    </div>
  )
}

export default EarningsPage
